import ExpenseItem from "./ExpenseItem";

function Expenses({ expenses }) {
  return (
    <Card>
      {expenses.map((item, index) => (
        <ExpenseItem
          key={index}
          title={item.title}
          amount={item.amount}
          date={item.date}
        />
      ))}
    </Card>
  );
}

export default Expenses;
